import React from 'react';
import PropTypes from 'prop-types';

const Display = (props) => (
    <div className="mt-md-2" >
        <div style={{ position: 'absolute', top: 0, right: 0 }}>{props.value}</div>
    </div>
);

Display.defaultProps = {
    expression: '',
    value: '0'
};

Display.propTypes = {
    value: PropTypes.string
};

export default Display;
